INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (2.1, 2, 1, 100, "2024/10/31 12:00:00", "2030/01/01 14:59:59", -416.5, 130011, "ヤマト", 0.0, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 3001, 3001100);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (5.68, 2, 4, 101, "2024/10/31 12:00:00", "2030/01/01 14:59:59", -416.5, 130011, "ヤマト", 0.0, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 3001, 3001101);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (0.0, 1, 1, 102, "2024/10/31 12:00:00", "2030/01/01 14:59:59", -416.5, 130011, "ヤマト", 0.0, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 3001, 3001102);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (0.0, 1, 1, 100, "2024/10/31 12:00:00", "2030/01/01 14:59:59", -416.5, 130211, "フブキ", 0.0, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 3002, 3002100);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (0.0, 1, 1, 101, "2024/10/31 12:00:00", "2030/01/01 14:59:59", -416.5, 130211, "フブキ", 0.0, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 3002, 3002101);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (8.53, 2, 5, 102, "2024/10/31 12:00:00", "2030/01/01 14:59:59", -416.5, 130211, "フブキ", 0.0, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 3002, 3002102);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (5.67, 1, 7, 103, "2024/10/31 12:00:00", "2030/01/01 14:59:59", -416.5, 130211, "フブキ", 0.0, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 3002, 3002103);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (0.0, 1, 1, 104, "2024/10/31 12:00:00", "2030/01/01 14:59:59", -416.5, 130211, "フブキ", 0.0, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 3002, 3002104);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (0.0, 3, 3, 300, "2024/10/31 12:00:00", "2030/01/01 14:59:59", -416.5, 130211, "フブキ", 0.0, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 3004, 3002300);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (0.0, 7, 7, 301, "2024/10/31 12:00:00", "2030/01/01 14:59:59", -416.5, 130211, "フブキ", 0.0, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 3005, 3002400);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (4.4, 1, 2, 200, "2024/10/31 12:00:00", "2030/01/01 14:59:59", -416.5, 130211, "フブキ", 0.0, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 3003, 3003200);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (0.0, 7, 7, 201, "2024/10/31 12:00:00", "2030/01/01 14:59:59", -416.5, 130211, "フブキ", 0.0, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 3003, 3003201);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (5.6, 2, 1, 202, "2024/10/31 12:00:00", "2030/01/01 14:59:59", -416.5, 130211, "フブキ", 0.0, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 3003, 3003202);
